import React from "react";
import "./Components.css";
import me from './me.jpg'
import Partilces from 'react-particles-js'

function Home() {
  return (
    
    <div className="home">
      <Partilces style={{color:'red',}}/>
      
        <img src={me} alt="Me"/>
        <h2>home</h2> 
  
    </div>
   
  );
}

export default Home;
